  `id_categorie` int(11) DEFAULT NULL,
  `slug` varchar(200) NOT NULL,
  `is_published` datetime DEFAULT NULL,
  PRIMARY KEY (`id_formation`),
  UNIQUE KEY `slug` (`slug`),
  KEY `fk_langues_formations` (`id_langue`),
